13. Donate/Participate in walkathons along with your friends in "Sports" service which supports HealthKit functionality.

"iHousing", the first Mobile App of the Hong Kong Housing Authority (HA) will provide a wide range of services by phases. It covers public housing services and monthly parking services. Users can download the App through their mobile devices and enjoy the following services at anytime anywhere:

• Using a Quick Response (QR) code provided by the App, users can pay rent / monthly parking fee at 7-Eleven, Circle K, VanGO Convenience Stores or U select;
• Users can pay rent / monthly parking fee by e-Payment Service through Faster Payment System (FPS);
• Check the rent / monthly parking fee position and payment history of rent / monthly parking fee for the past six months;
• Locate nearby Estate Shroff Offices, convenience stores and supermarkets for rent payment of public rental housing by using Lands Department’s Geolnfo Map (Not applicable to carpark users);
• Receive notification messages of latest e-News of the HA;
• Receive rent / monthly parking fee payment reminder by push notification;
• Hong Kong weather information; and
• Receive notification messages of all regular / scheduled utilities services suspension of estate.
